import React, { useEffect ,useState} from 'react'

function Show  () {

    var [data, setData] =useState([]);

    useEffect(()=>{
        fetch('http://localhost:5224/api/home')
        .then(res=>res.json())
        .then(val=>{
            console.log(val);
            console.log(val);
            setData(val);
        })
    },[]);
  return (
    <div className='container'>
    <h1>SHOW DATA FROM API</h1>
    <table className="table">
        <tr>
            <th>emp</th>
            <th>employeeName</th>
        </tr>
        {
            data.map((number) =>
            <tr>
                <td>{number.Id}</td>
                <td>{number.DeptName}</td>
            </tr>
            )
        }
        </table>
    </div>
  )
}

export default Show
